import React from "react";
import styled from "styled-components";
import { useHistory } from "react-router-dom";
import { NavLink as Link } from "react-router-dom";
import Home from "../pages/Home";
function Navbar() {
  const history = useHistory();

  const HeaderLeftListClick = ({ url, children }) => {
    return <_ClickDiv onClick={() => history.push(url)}>{children}</_ClickDiv>;
  };
  const HeaderRightListClick = ({url, children }) => {
    return <HeaderRightList onClick={() => history.push(url)}>{children}</HeaderRightList>;

  }
  const ClickDiv2 = ({url, children }) => {

    return <div onClick={() => history.push(url)}>{children}</div>
  }
  return (
    <Body>


      <Header>
        <AutohubLogoPart>
          <ClickDiv2 url="./">
            <AutohubLogo src="/images/AUTOHUB Logo.png" />
          </ClickDiv2>
        </AutohubLogoPart>

        <HeaderLeftListPart>
        {[["./Buy", "살때"],["./Sell", "팔때"], ["./Managed", "직영차"], ["./AboutAutohub", "벤츠"],["./CCenter", "제네시스"]].map((el, key) => (
                <HeaderLeftListClick key={key} primary url={el[0]}>{el[1]}</HeaderLeftListClick>
              ))}


          {/* <HeaderLeftListClick url="./Buy">살때</HeaderLeftListClick>
          <HeaderLeftListClick url="./Sell">팔때</HeaderLeftListClick>
          <HeaderLeftListClick url="./Managed">직영차</HeaderLeftListClick>
          <HeaderLeftListClick url="./AboutAutohub"> 
            단지안내
          </HeaderLeftListClick>
          <HeaderLeftListClick url="./CCenter">고객센터</HeaderLeftListClick> */}
        </HeaderLeftListPart>

        <HeaderRightListPart>
          <HeaderRightListClick url="./Join">회원가입</HeaderRightListClick>
          <HeaderRightListClick url="./Login">로그인</HeaderRightListClick>
        </HeaderRightListPart>
      </Header>
    </Body>
  );
}

const Body = styled.body`
  box-sizing: border-box;
  margin: 0;
  padding: 0;
`;

const Header = styled.header`
  height: 80px;
  width: 100%;
  background-color: #f11843;
  color: #fff;
  position: fixed;
  margin: 0;
`;
const AutohubLogoPart = styled.div``;
const AutohubLogo = styled.img`
  float: left;
  width: 7rem;
  height: 3rem;

  padding-top: 10px;
  margin-left: 50px;
  cursor: pointer;
`;

const HeaderLeftListPart = styled.ul`
  list-style: none;
`;
const HeaderLeftList = styled.li`
  float: left;

  padding: 13px 13px;

  margin-left: 30px;
  text-decoration: none;
  color: #fff;
  font-weight: bold;
  font-size: 15px;
  cursor: pointer;

  &:hover {
    border-bottom: 3px solid white;
  }
`;
const HeaderRightListPart = styled.ul``;
const HeaderRightList = styled.li`
  list-style: none;
  float: right;
  text-decoration: none;
  padding: 13px 30px;
  margin-right: 30px;
  margin-left: -40px;

  color: #fff;
  font-weight: bold;
  font-size: 15px;
  cursor: pointer;

  &:hover {
    border-bottom: 3px solid white;
  }
`;

const _ClickDiv = styled.div`
  cursor: pointer;
  float: left;

  padding: 13px 13px;

  margin-left: 30px;
  text-decoration: none;
  color: #fff;
  font-weight: bold;
  font-size: 15px;
  cursor: pointer;

  &:hover {
    border-bottom: 3px solid white;
  }
`;
const ClickDiv2 = styled.div`

`;






export default Navbar;
